drop table if exists movies;
drop table if exists ratings;
drop table if exists tags;
drop table if exists users;
drop table if exists emails;
drop table if exists occupations;
drop table if exists genres;
drop table if exists movies_genres;

create table movies(
	id int primary key,
	title varchar(255),
	year int,
	genres varchar(255)
);

create table ratings(
	id int primary key,
	user_id int,
	movie_id int,
	rating float,
	timestamp int
);

create table tags(
	id int primary key,
	user_id int,
	movie_id int,
	tag varchar(255),
	timestamp int
);

create table users(
	id int primary key,
	name varchar(255),
	email varchar(255),
	gender varchar(16),
	register_date varchar(32),
	occupation varchar(255)
);





create table genres(
	id integer primary key,
	genre varchar(32)
);

select t.genre from
(with divided_genres(genre, combined_genres) as 
(select null, genres
from movies
union all
select case when instr(combined_genres, '|') = 0 then combined_genres else substr(combined_genres, 1, instr(combined_genres, '|') - 1) end,
case when instr(combined_genres, '|') = 0 then null else substr(combined_genres, instr(combined_genres, '|') + 1) end
from divided_genres
where combined_genres is not null)
select genre
from divided_genres
where genre is not null
group by genre) as t;

create table movies_n(
	id integer primary key,
	title varchar(64),
	year int,
	check(year >= 1895 and year <= 2021)
);

select m.title, m.year from movies as m;

create table movies_genres(
	movie_id integer,
	genre_id integer,
	foreign key (movie_id) references movies_n(id),
	foreign key (genre_id) references genres(id)
);

select mn.id, g.id
from movies_n as mn
inner join movies as m
on mn.title = m.title
inner join genres as g
on instr(m.genres, g.genre) > 0;


create table occupations(
	id integer primary key,
	occupation varchar(32)
);

select u.occupation
from users as u
group by u.occupation;

create table users_n(
	id integer primary key,
	first_name varchar(128),
	last_name varchar(128),
	gender varchar(8),
	occupation_id integer,
	foreign key (occupation_id) references occupations(id)
	check (gender = 'male' or gender = 'female')
);

select substr(u.name, 0, instr(u.name, ' ')), substr(u.name, instr(u.name, ' ') + 1), u.gender, oc.id
from users as u
inner join occupations as oc
on oc.occupation = u.occupation;

create table emails(
	id integer primary key,
	email varchar(255),
	user_id integer,
	register_date date,
	foreign key (user_id) references users_n(id)
	check (register_date >= date('1965-01-01') and register_date <= date())
);

select u.email, un.id, u.register_date
from users as u
inner join users_n as un
on (un.first_name || ' ' || un.last_name) = u.name;

create table ratings_n(
	id integer primary key,
	user_id integer,
	movie_id integer,
	rating float default 2.5,
	timestamp integer,
	foreign key (user_id) references users_n(id),
	foreign key (movie_id) references movies_n(id)
	check (rating >= 0.0 and rating <= 5.0)
);

select distinct un.id, mn.id, r.rating, r.timestamp
from ratings as r
inner join users as u
on r.user_id = u.id
inner join users_n as un
on (un.first_name || ' ' || un.last_name) = u.name
inner join movies as m
on r.movie_id = m.id
inner join movies_n as mn
on m.title = mn.title;

create table tags_n(
	id integer primary key,
	user_id integer,
	movie_id integer,
	tag varchar(128),
	timestamp integer,
	foreign key (user_id) references users_n(id),
	foreign key (movie_id) references movies_n(id)
);

select un.id, mn.id, t.tag, t.timestamp
from tags as t
inner join users as u
on t.user_id = u.id
inner join users_n as un
on (un.first_name || ' ' || un.last_name) = u.name
inner join movies as m
on t.movie_id = m.id
inner join movies_n as mn
on m.title = mn.title;

drop table movies;

alter table movies_n
rename to movies;

drop table users;

alter table users_n
rename to users;

drop table ratings;

alter table ratings_n
rename to ratings;

drop table tags;

alter table tags_n
rename to tags;

create index users_last_names
on users (last_name);

create index movies_titles
on movies (title);

create index movies_production_years
on movies (year);
